import styled from "styled-components";
import { Twitter } from "@styled-icons/boxicons-logos/Twitter";

const Container = styled.div`
    margin: 0;
    min-width: 250px;
`;

const Logo = styled(Twitter)`
    color: #00aaee;
    width: 45px;
    height: 45px;
`;

export default function Sidebar() {
    return (
        <Container>
            <Logo />
            <></>
        </Container>
    );
}
